def A346971(n):
    c, nlist = 1, list(range(1,n+1))
    while True:
        mlist = [m for m in nlist if c % m]
        if len(mlist) == 0: return c
        p = max(mlist)
        for a in range(p,c,p):
            for m in mlist:
                if a % m and (c-a) % m:
                    break
            else:
                return c
        c += 1 # _Chai Wah Wu_, Oct 13 2021

